import React from 'react';
import BotSpecs from './BotSpecs';

function SomeComponent() {
  // Assuming you have a bot object with the required properties
  const bot = {
    name: 'Bot Name',
    health: 100,
    damage: 50,
    armor: 30,
    bot_class: 'Assault',
    catchphrase: 'I am a bot!',
    created_at: '2023-11-04',
    updated_at: '2023-11-05',
  };

  return (
    <div>
      {/* Pass the bot object as a prop to BotSpecs */}
      <BotSpecs bot={bot} />
    </div>
  );
}

export default SomeComponent;
